import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Set a mobile viewport to ensure the mobile menu is active
    await page.setViewportSize({ width: 375, height: 667 });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_mobile_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_mobile_view.png'));

    // Open the mobile menu by clicking the "All" button
    const menuTrigger = page.locator('div.nav-menu:has-text("All")');
    await menuTrigger.waitFor({ state: 'visible', timeout: 5000 });
    await menuTrigger.click();

    // Wait for the mobile menu overlay to become visible
    const mobileMenuOverlay = page.locator('#mobileMenuOverlay');
    await mobileMenuOverlay.waitFor({ state: 'visible', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_open.png'));

    // Click on the "Books" link within the mobile menu
    const booksLink = page.locator('.mobile-menu a:has-text("Books")').first();
    await booksLink.waitFor({ state: 'visible', timeout: 5000 });
    await booksLink.click();

    // Wait for the page content to update and verify by checking for the "Books" header
    // The JS code simulates a loading state, so we wait for the result.
    const booksHeader = page.locator('h2:has-text("Books")');
    await booksHeader.waitFor({ state: 'visible', timeout: 5000 });
    const extractedData = {
      categoryTitle: await booksHeader.innerText()
    };

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_books_category_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_books_category_page.png'));

    // Re-open the menu to test closing it
    await menuTrigger.click();
    await mobileMenuOverlay.waitFor({ state: 'visible', timeout: 5000 });

    // Click the close button within the mobile menu
    const closeButton = page.locator('#mobileMenuOverlay .close-mobile-menu');
    await closeButton.waitFor({ state: 'visible', timeout: 5000 });
    await closeButton.click();

    // Verify the menu is now hidden
    await mobileMenuOverlay.waitFor({ state: 'hidden', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_menu_closed.png'));

    return {
      success: true,
      action: "Successfully tested mobile menu navigation: opened menu, navigated to 'Books', and closed menu.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test mobile menu navigation",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
